import React from 'react'
import {Link} from 'react-router-dom'

export const ProductsList = ({ products }) => {
//   if (!products.length) {
//     return <p >Ссылок пока нет</p>;
//   }
// console.log(products.current.Array);

    
    return (
        <div>
            { products.current.map( (product, index) => {
                return(
                    <p>{product.name}</p>
                )
            })
        }
        </div>
    )
}
